import React from 'react';
import './App.css';
import NavBar from './components/NavBar';
import SeeProjects from './components/SeeProjects';
import {Grid, Typography} from "@material-ui/core";
import { makeStyles } from '@material-ui/core/styles';
import ProjectContent from './components/ProjectContent';

const useStyles = makeStyles((theme) => ({
  body: {
    marginTop: '400px'
  },

  projects:{
    border: 'solid 1px red'
  },

  example:{
    color: "white",
    fontSize: '40px',
    border: 'solid 1px rgb(228, 130, 74)',

  },

  content:{
    display: 'inline-block'
  }

}))

function App() {
  const classes = useStyles();
  return (
    <div>
      <div className="App">
        <Grid container direction="column">
          <Grid item >
            <NavBar />
          </Grid >
        </Grid>
        <SeeProjects />
      </div>
      <div className="Projects">
        <Grid container direction='row' className={classes.projects} >
          <Grid item className={classes.example} xs={false} sm={2}>
          </Grid>
          <Grid item className={classes.example} xs={12} sm={8}>
            <ProjectContent />
          </Grid>
          <Grid item className={classes.example} xs={false} sm={2}>
          </Grid>
        </Grid>
      </div>

    </div>
  );
}

export default App;
